import React from 'react';
import { storiesOf } from '@storybook/react';
import { action } from '@storybook/addon-actions';

import HttpError from './HttpError.component';
import IconsProvider from '../IconsProvider';

const commonStyle = {
	height: '60rem',
	backgroundPosition: 'left bottom',
	backgroundRepeat: 'no-repeat',
};

const forbiddenStyle = {
	...commonStyle,
	backgroundPositionX: '10rem',
	backgroundImage:
		'url("data:image/svg+xml;base64,")',
};

const notFoundStyle = {
	...commonStyle,
	backgroundPositionY: '25rem',
	backgroundImage:
		'url("data:image/svg+xml;base64,")',
};

const maintenanceStyle = {
	...commonStyle,
	height: '40rem',
	paddingTop: '0',
	paddingLeft: '50rem',
	marginTop: '20rem',
	backgroundImage:
		'url("data:image/svg+xml;base64,")',
};

const forbiddenProps = {
	status: 403,
	title: 'Access denied',
	message: 'You are not allowed to access this page',
};

const notFoundProps = {
	status: 404,
	title: 'Oops ...',
	message: 'The page you are looking for cannot be found',
};

const maintenanceProps = {
	status: 503,
	title: 'Sorry',
	message: 'We are under maintenance. Please retry in few minutes.',
};

const notFoundWithRedirectProps = {
	status: 404,
	title: 'Oops ...',
	message: 'The page you are looking for cannot be found',
	action: {
		onClick: action('onBackActionClick'),
		label: 'Start over',
	},
};

// Style here is for demonstration purpose, you should use generated className with its status code.

storiesOf('Messaging & Communication/HttpError', module)
	.addDecorator(story => (
		<div className="col-lg-offset-2 col-lg-8">
			<IconsProvider
				bundles={[
					'https://statics-dev.cloud.talend.com/@talend/icons/6.1.4/dist/svg-bundle/all.svg',
				]}
			/>
			{story()}
		</div>
	))
	.add('Forbidden', () => <HttpError style={forbiddenStyle} {...forbiddenProps} />)
	.add('NotFound', () => <HttpError style={notFoundStyle} {...notFoundProps} />)
	.add('NotFound with redirect action', () => (
		<HttpError style={notFoundStyle} {...notFoundWithRedirectProps} />
	))
	.add('Maintenance', () => <HttpError style={maintenanceStyle} {...maintenanceProps} />);
